import React from 'react';
import classes from "./Product.module.css";
import MyButton from "../UI/button/MyButton";

const Product = ({id, name, sku, price, productType, ...props}) => {

    const axios = require('axios').default;

    const deleteProduct = (id) => {
        axios.delete(`http://localhost:8888/shop-sw/back-end/public/${id}`)
            .then(function(response){
                console.log(response.data)
        });
    }

    if(id != null) {
            return (
                <div className={classes.product} key={id}>
                        <p>{sku}</p>
                        <p>{name}</p>
                        <p>{price}</p>
                        <p>{productType}</p>
                        <div className={classes.buttons__contaioner}>
                            <button onClick={() => deleteProduct(id)} className={classes.btn}>x</button>
                        </div>
                </div>
            );
    }
};

export default Product;
